import classes from './Cart.module.css';
import Model from '../UI/Model';

function Cart(props){
    const cartList=<ul className={classes['cart-items']}>{[{id: 'm1',
    name: 'Sushi',
    description: 'Finest fish and veggies',
    price: 'Rs 400',}].map(items=><li>{items.name}</li>)}</ul>;
return(
    <Model onChange={props.onDisableCart}>
        {cartList}
        <div className={classes.total}>
        <span>Total Amount </span>
        <span> Rs 400</span>
        </div>
        <div className={classes.actions}>
            <button className={classes['button--alt']} onClick={props.onDisableCart}>Close</button>
            <button className={classes.button}>Order</button>

        </div>
    </Model>
);

}

export default Cart;
